import { Link } from "react-router-dom";

const MainGuest = () => {
  return (
    <Wrapper>
      <Logo>
        <LogoSVG />
      </Logo>
      <Container>
        <Title>
          드라마, 예능, 영화, 스포츠를 한번에! 지금 시작하세요!!! MOVING!
        </Title>
        <Buttons>
          <Link to={"/login"}>로그인</Link>
          <Link to={"/signup"}>회원가입</Link>
        </Buttons>
      </Container>
    </Wrapper>
  );
};

export default MainGuest;
